Je bevestigt de betaling op de manier die bij jouw bank gebruikelijk is.</li><li>Klaar! Appeltje eitje toch?</li></ol></div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Is Tikkie voor iedereen?</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">Ja, iedereen met een Nederlandse betaalrekening kan Tikkie gebruiken. Het maakt niet uit bij welke bank je zit. Je betaalt altijd eenvoudig via je eigen bank met iDEAL.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Is Tikkie veilig?</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">Tikkie is mogelijk gemaakt door ABN AMRO en voldoet aan strenge veiligheidseisen. De link begint met https. Dit betekent dat je gegevens versleuteld zijn. Een Tikkie betaalverzoekje ziet er altijd zo uit: https://tikkie.me/pay/... Als dit niet zo is, klik er dan niet op en <a class="exampleLink" href="https://api.whatsapp.com/send?phone=31613768528">meld het ons</a>.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Heb ik mijn paslezer nodig om te betalen?</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">Bij de meeste banken kun je in je mobiel bankieren-app instellen of je tot een bepaald bedrag zonder paslezer wilt betalen. Soms is het nodig om de paslezer alleen bij de eerste betaling aan een vriend te gebruiken.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Is het gratis?</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">We rekenen geen transactiekosten voor de betalingen via iDEAL.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Waarom zie ik een onbekende rekening?</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">Je betaalt eerst aan ABN AMRO. ABN AMRO betaalt aan jouw vriend.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><v-pane ng-repeat="pane in items track by $index" ng-if="pane.category == 'landingpage'" class="ng-scope ng-isolate-scope"><v-pane-header class="ng-scope ng-isolate-scope" role="tab" tabindex="0" aria-selected="false" aria-expanded="false"><div ng-transclude=""><span class="ng-binding ng-scope">Misbruik melden</span></div></v-pane-header><v-pane-content class="ng-scope ng-isolate-scope" role="tabpanel" aria-hidden="true" style="max-height: 0px;"><div ng-transclude=""><div ng-bind-html="pane.content" class="ng-binding ng-scope">Als je echt het idee hebt dat het verzoekje niet ok is, kun je hier <a class="exampleLink" href="https://api.whatsapp.com/send?phone=31613768528">misbruik melden</a>. In de <a class="exampleLink" data-savepage-href="/privacy/nl/v2/" href="https://tikkie.me/privacy/nl/v2/">privacyverklaring</a> lees je hier meer over.</div></div></v-pane-content></v-pane><!-- end ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $index --><!-- ngIf: pane.category == 'landingpage' --><!-- end ngRepeat: pane in items track by $in